import React, { useEffect, useMemo } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { useState } from "react";

const DetailsOfQuestion = () => {
  const [data, setData] = useState("");
  const params = useParams();
  const [ansoptionA, setansoptionA] = useState("");
  const questionId = params.questionId;
  const topicName = params.topicName;
  const examId = params.examId;
  const navigate = useNavigate();
  console.log("Topic Name....>", topicName);
  console.log("Question Id...>", questionId);
  var topicId;
  var myobj;
  // var optionA="Hello";
  const map = {
    questionId: questionId,
  };
  async function examDetails ()  {
      
    console.log("exam Details is called....");
    console.log(examId);
    let map={
       examId: examId,
    }
    console.log("map....",map);
    const response = await fetch(
      "https://localhost:8443/onlineexam/control/questionMasterList",
      {
        method: "POST",
        credentials: "include",
        body: JSON.stringify(map),
        headers: {
          "Content-type": "application/json",
        },
      }
    );

    const result = await response.json();
    console.log("myresult.....",result);
    console.log("result...", result.ExamTopicNameMapping.ExamTopicMapping);
    const output = result.ExamTopicNameMapping.ExamTopicMapping;
    console.log("output..........", output);
    output.map((obj, value) => {
      examname = obj.examName;
      console.log(examname);
      SetexamName(examname);
    });
    console.log("My exam Name....", examname);
    const myexamname = JSON.stringify(examname);
    console.log("myexamname..........", myexamname);
    examname = myexamname;
    setTopicData([...result.ExamTopicNameMapping.ExamTopicMapping]);
    // console.log("topic data...", result.ExamTopicNameMapping.ExamTopicMapping);

    console.log("***********************************************");
    console.log("NAREN - MASTER");

    console.log("topicData....", topicData);

    console.log("examName.............", examname);
  };
  useEffect(() => {
  
  }, []);

  console.log("******************************************" + ansoptionA);

  return (
    <div className="my-5">
      <div className="d-flex shadow">
        <p className="text-primary font-weight-bold my-2 mx-2">
          Question Detail -{" "}
        </p>
        <div className="my-2 text-uppercase font-weight-bold">
          {data.questionDetail}
        </div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option A - </p>
        <div className="my-2">{ansoptionA}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option B - </p>
        <div className="my-2">{data.optionB}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option C - </p>
        <div className="my-2">{data.optionC}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option D - </p>
        <div className="my-2">{data.optionD}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option E - </p>
        <div className="my-2">{data.optionE}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Answer - </p>
        <div className="my-2">{data.answer}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">TopicName - </p>
        <div className="my-2">{topicName}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">QuestionType - </p>
        <div className="my-2">{data.questionType}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">AnswerValue - </p>
        <div className="my-2">{data.answerValue}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">DifficultyLevel - </p>
        <div className="my-2">{data.difficultyLevel}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Num Answers - </p>
        <div className="my-2">{data.numAnswers}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">NegativeMarkValue - </p>
        <div className="my-2">{data.negativeMarkValue}</div>
      </div>

      <button
        className="btn btn-primary my-5"
        onClick={navigate(
          `/updateExam/examdetails/question-topicView/${topicId}/${examId}`
        )}
      >
        Back
      </button>
      <button className="btn btn-primary offset-9 my-5">Edit</button>
    </div>
  );
};

export default DetailsOfQuestion;
